import{_ as a,o as r,c as t,e}from"./chunks/framework.78e651f5.js";const f=JSON.parse('{"title":"МИСиС","description":"Фаблаб","frontmatter":{"title":"МИСиС","description":"Фаблаб","date":"2015-04-26","icon":"fab.png","cover":"replicator.jpg","address":"Крымский вал, д. 3","city":"г. Москва","place":"м. Октябрьская","coord":[55.729524440313234,37.60889885467958],"vk":"fablabmoscow","facebook":"fablab77","instagram":"fablabmoscow","url":"https://www.fablab77.online","email":"fablab@misis.ru","youtube-channel":"UCLjbMRbS_1uQAt2UHZgdGFw","youtube":"https://youtu.be/aBoicG5mDfs","status":"open"},"headers":[],"relativePath":"workshop/catalog/fablab-misis/index.md","filePath":"workshop/catalog/fablab-misis/index.md"}'),o={name:"workshop/catalog/fablab-misis/index.md"},n=e('<h2 id="что-такое-фаблаб" tabindex="-1">Что такое ФАБЛАБ <a class="header-anchor" href="#что-такое-фаблаб" aria-label="Permalink to &quot;Что такое ФАБЛАБ&quot;">​</a></h2><p>Сегодня любой материальный продукт изготовленный человеком является результатом обработки природных или синтезированных материалов, но в будущем появятся системы, объединяющие синтез материалов и придание им необходимых формы и структуры. Собственно, такие системы уже существуют, но пока только в фантастических произведениях, например <a href="http://en.wikipedia.org/wiki/Replicator_%28Star_Trek%29" class="external-link" target="_blank" rel="noreferrer">репликатор</a> из «Звездного пути», способный по команде материализовать чашку горячего чая или поврежденную вражеской атакой деталь космического крессера. В будущем, для того, чтобы <strong>изготовить все что угодно</strong> (за исключением, наверное, одушевленных предметов) достаточно будет лишь передать<a href="http://en.wikipedia.org/wiki/Replicator_%28Star_Trek%29" class="external-link" target="_blank" rel="noreferrer">репликатору</a> или молекулярному ассемблеру инструкции в виде компьютерного файла.</p><p>В будущем у нас появится возможность изготавливать все, что угодно, сегодня у нас есть возможность изготовить почти все, что угодно. И эта возможность называется <strong>ФАБЛАБ</strong>. ФАБЛАБ, появившийся в начале 21-го века — это функциональный прототип репликатора из 24-го столетия.</p><p><strong>ФАБЛАБ</strong> — продукт цифровой революции: вслед за цифровой фотографией и цифровой музыкой приходит цифровое производство. Управляемые компьютерными программами «умные» машины обрабатывают разнообразные материалы, убирая все лишнее или наоборот, добавляя новые элементы, придавая им необходимую форму — так появляются плоские и объемные детали: рычаги, маховики, шестеренки, и даже электронные платы…. Человеку лишь остается собрать воедино все детали…</p><p>Самые заметные изменения в нашей жизни, вызванные цифровой революцией, последовали не за появлением компьютера, а за появлением <strong>доступных компьютеров</strong>. Первые станки с программным управлением появились в 40-хгодах прошлого столетия, первое устройство «быстрого прототипирования» было коммерциализированно в середине80-х — цифровое производство существует уже давно, но лишь с появлением <strong>ФАБЛАБОВ</strong> цифровое производство стало доступным — <strong>ФАБЛАБ</strong> это шаг к <strong>персональному производству</strong>. Итак…</p><p><strong>ФАБЛАБ</strong> — это набор технологических и интеллектуальных ресурсов для превращения идей в функциональные прототипы.</p><p><strong>ФАБЛАБ</strong> — это кратчайший путь от эскиза до готового изделия, это кратчайший путь от мечты, до ее воплощения.</p><p><strong>ФАБЛАБ</strong> — возможность сделать (почти) все, что угодно.</p><p>ФАБЛАБ при НИТУ «МИСиС» появился и развивается по тем же принципам, что и все остальные лаборатории проекта, основные из которых изложены в <a href="http://fablab77.ru/fablab/charter" class="external-link" target="_blank" rel="noreferrer">Хартии</a>.</p><h3 id="что-фаблаб-может-дать-вам" tabindex="-1">Что ФАБЛАБ может дать вам <a class="header-anchor" href="#что-фаблаб-может-дать-вам" aria-label="Permalink to &quot;Что ФАБЛАБ может дать вам&quot;">​</a></h3><p>Любому инициативному и увлеченному индивиду или коллективу ФАБЛАБ дает технологическую площадку для реализации идей и проверки концепций.</p><p><strong>Да</strong>, оборудование и технологии ФАБЛАБ действительно позволяют сделать (почти) все что угодно.</p><p><strong>Нет</strong>, мы не работаем «по чертежам заказчика».</p><p><strong>Да</strong>, Вам придется самостоятельно освоить работу с нашими машинами и технологиями.</p><p><strong>Да</strong>, в этом мы поможем.</p><p>Мы приглашаем к участию в регулярных тренингах или можем подготовить для Вас индивидуальную программу. В любом случае, обучение в ФАБЛАБ проходит в режиме реализации проектов. Мы все учимся, когда делаем.</p><p>Создание и развитие лабораторий цифрового производства <strong>ФАБЛАБ</strong> не нацелено на получение прибыли, мы работаем в режиме non profit, однако мы не можем предоставлять все наши услуги бесплатно. В зависимости от типа проекта, затрачиваемого на его реализацию времени и задействованного оборудования, назначаются определенные сборы, компенсирующие затраты на материалы и обслуживание оборудования.</p><p>Лаборатория цифрового производства <strong>ФАБЛАБ</strong> не нацелена на получение прибыли, но проекты, реализуемые в <strong>ФАБЛАБ</strong>, могут иметь потенциал для успешной коммерческой реализации. Однако коммерциализация проектов, рожденных в стенах <strong>ФАБЛАБ</strong>, должна проходить уже за их пределами. <strong>ФАБЛАБ</strong>, это место, где мечты обретают материальную форму, но это не место для их тиражирования. Серийное производство противоречит не столько техническим ограничениям <strong>ФАБЛАБ</strong>, сколько идеологическим.</p><h2 id="доступ" tabindex="-1">Доступ <a class="header-anchor" href="#доступ" aria-label="Permalink to &quot;Доступ&quot;">​</a></h2><h3 id="творческим-индивидам" tabindex="-1">Творческим индивидам <a class="header-anchor" href="#творческим-индивидам" aria-label="Permalink to &quot;Творческим индивидам&quot;">​</a></h3><p>В голове свербит идея, руки чешутся в стремлении ее воплощения? Приходите в ФАБЛАБ.</p><p>Чтобы получить доступ к работе с оборудованием необходимо пройти обучение.</p><h3 id="образовательным-учреждениям" tabindex="-1">Образовательным учреждениям <a class="header-anchor" href="#образовательным-учреждениям" aria-label="Permalink to &quot;Образовательным учреждениям&quot;">​</a></h3><p>Хочется добавить в образовательный процесс движения, шума фрезерного станка и запаха свежего термопласта? Хочется развить навыки командной и проектной работы? Приходите и приводите своих учащихся в ФАБЛАБ.</p><p>Начните с экскурсии, оставайтесь для реализации проектов.</p><h3 id="малому-бизнесу" tabindex="-1">Малому бизнесу <a class="header-anchor" href="#малому-бизнесу" aria-label="Permalink to &quot;Малому бизнесу&quot;">​</a></h3><p>У вас родилась блестящая инновационная идея, реализуемость которой требует проверки — приходите в ФАБЛАБ.</p><p>У вас нет времени на самостоятельное проектирование, изготовление макета и функционального прототипа — обращайтесь к резидентам ФАБЛАБ, кто-нибудь обязательно поможет (но вряд ли безвозмездно) — напишите письмо с описанием вашего проекта на <a href="mailto:fablab@misis.ru" target="_blank" rel="noreferrer">fablab@misis.ru</a>.</p><p><a href="http://fablab77.ru/" class="external-link" target="_blank" rel="noreferrer">http://fablab77.ru/</a></p>',29),s=[n];function l(i,p,g,c,h,b){return r(),t("div",null,s)}const _=a(o,[["render",l]]);export{f as __pageData,_ as default};
